import React, { useEffect, useState } from 'react';
import { fetchInfluence } from '../services/api';

function InfluencePage() {
  const [data, setData] = useState([]);

  useEffect(() => {
    fetchInfluence().then(res => {
      setData(res.data);
    });
  }, []);

  return (
    <div>
      <h2>Influence Ranking</h2>
      <table>
        <thead>
          <tr>
            <th>Community</th>
            <th>Author</th>
            <th>Author PR</th>
            <th>Community PR</th>
            <th>Score</th>
          </tr>
        </thead>
        <tbody>
          {data.map((row, idx) => (
            <tr key={idx}>
              <td>{row.community_id}</td>
              <td>{row.author}</td>
              <td>{row.author_pagerank.toFixed(3)}</td>
              <td>{row.community_pagerank.toFixed(3)}</td>
              <td>{row.final_score.toFixed(5)}</td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
}

export default InfluencePage;
